body {
  height: 100vh;
  width: 100vw;
  margin: 0;
  padding: 0;
  display: grid;
  grid-template-rows: 1fr 9fr;
  grid-template-areas: "h" "m";
  background: #fff;
  color: #000; }

header {
  grid-area: h;
  height: 100%;
  width: 100%; }
  header nav {
    width: 30%;
    height: 100%;
    float: right;
    margin-right: 5%;
    margin-top: 1%; }
    header nav ul {
      display: flex;
      justify-content: space-around;
      list-style-type: none; }
    header nav .clicked {
      height: 110%;
      background: #2AA7F0; }

main {
  grid-area: m;
  height: 100%;
  width: 100%;
  display: grid;
  grid-template-columns: 2fr 1fr;
  grid-template-areas: "t p"; }
  main #text {
    grid-area: t;
    height: 100%;
    width: 100%;
    display: flex;
    justify-content: center;
    align-items: center; }
    main #text div h1, main #text div p {
      margin: 0; }
    main #text div h1 {
      font-size: 6rem; }
    main #text div p {
      text-align: right; }
  main #pic {
    grid-area: p;
    height: 100%;
    width: 100%;
    background: #2AA7F0; }
